import s from './AdminAddChangeNewsPage.module.css';
import { useEffect } from 'react';

const AdminAddChangeNewsPage = () => {
	let { newsId } = useParams();

	useEffect(() => {
		console.log(newsId);
	}, [newsId]);

	return <div className={s.add_news}>{newsId ? <h1>Редагування події</h1> : <h1>Створення нової події</h1>}</div>;
};

export default AdminAddChangeNewsPage;
